import React from "react";
import cover from '../Assets/profile.png';
import './css/Circle.css';
import facebooksvg from '../Assets/icons8-facebook.svg';
import gitscg from '../Assets/icons8-github.svg';
import gmailsvg from '../Assets/icons8-gmail.svg';
import Linkedsvg from '../Assets/icons8-linkedin-logo.svg';

const Midl = () => {
  return (
    <div className="_ml_20">
      <div className="_ml_10">
        <h1>Hello Developer</h1>
        <h3>I am Subarna Dahal</h3>
        <p>Hello, I am a web developer</p>
        <div className="profile-container">
          <img src={cover} alt="pic" />
          <div className="social-links">
            <a href='#'><img src={facebooksvg} alt="Facebook" /></a>
            <a href='#'><img src={gitscg} alt="Github" /></a>
            <a href='#'><img src={gmailsvg} alt="Gmail" /></a>
            <a href='#'><img src={Linkedsvg} alt="LinkedIn" /></a>
          </div>
        </div>
      </div>
      <div className="_formed">
        Programming Languge
        <h2>React</h2>
        <h2>Java Script</h2>
        <h2>Node js</h2>
        <h2>Express</h2>
      </div>
    </div>
  )
}

export default Midl;
